description:
This is a video I made for the Skinny Puppy Song Past Present off the Greater Wrong of the Right album

Unfortunately I was never able to fully complete this one, as the project file got damaged towards the end of me working on it and I would have had to start from from scratch or just use it as is, and even unfinished, I still think it cme out cool enough that I am happy with it. The things I wanted to change were small anywways, like I felt the fractal stuff in the middle went on just a little too long, and I always was debating whether the the lyric track was distracting, but anyways here it is. 

